app.controller('socketTest', function ($scope,$timeout,$http) {

    $scope.socketUser = [];
    $scope.query= 'appName=Terminal&AppId=7002738&AppSecret=cI790Mf&client_type=PARTNER_ANDROID';
    $scope.url= 'http://localhost:3000';
    var events = {
        updateLatLng: 'update-lat-lng',
        'tripNotification':'trip-notification',
        'acceptCall':'accept-call',
        'Acknowledgement':'Send-Acknowledge',
        CALL_DRIVER: 'CALL_DRIVER',
        CALL_DRIVER_ACKNOWLEDGE: 'CALL_DRIVER_ACKNOWLEDGE',
        DRIVER_ACCEPTED: 'DRIVER_ACCEPTED',
        DRIVER_ARRIVED: 'DRIVER_ARRIVED',
        DRIVER_STARTED: 'DRIVER_STARTED',
        TRIP_CANCELLED: 'TRIP_CANCELLED',
        DRIVER_BATCH_CANCELLED: 'DRIVER_BATCH_CANCELLED',
        ADMIN_CANCELLED: 'ADMIN_CANCELLED',
        TRIP_FINISHED: 'TRIP_FINISHED',
        TRIP_FEEDBACK_DRIVER: 'TRIP_FEEDBACK_DRIVER',
        BATCH_TRIP_COMPLETED: 'BATCH_TRIP_COMPLETED'
    }
    var timer = 20;
    $scope.add = function(){
        $scope.socketUser.push({
            query:$scope.query,
            url:$scope.url,
            data:'',
            driver:'',
            driverJSON:'',
            AUTH_SUCCESS:false,
            connect: connection,
            status_text:'Connect',
            class:'btn-default',
            timer:0,
            acceptCall:acceptCall,
            received_call:false,
            received_call_multi:false,
            disconnect:disconnect
        })
    };
    function connection(item){

        if (item.driver != '') {
            item.driver = item.driver.replace(/ObjectId/g, '')
            item.driver = item.driver.replace(/ISODate/g, '')
            item.driver = item.driver.replace(/NumberInt/g, '')
            item.driver = item.driver.replace(/"\)/g, '"')
            item.driver = item.driver.replace(/\)/g, '"')
            item.driver = item.driver.replace(/\("/g, '"')
            item.driver = item.driver.replace(/\(/g, '"')
            item.driverJSON = JSON.parse(item.driver)
            var update = {
                _id: item.driverJSON._id,
                token_id: item.driverJSON.token_id,
                lat: item.driverJSON.current_lat, // latitude
                lng: item.driverJSON.current_lng, // longitude
                status: 'free', // longitude
            }

            item.query = `appName=Terminal&AppId=7002738&AppSecret=cI790Mf&client_type=PARTNER_ANDROID&client_id=${item.driverJSON._id}&client_token=${item.driverJSON.token_id}&uuid=11111111111111111111111111111111111d`;
            item.socket = io.connect(item.url, {
                transports: ['websocket'],
                query: item.query
            });

            item.socket.on('AUTH_SUCCESS', function () {

         console.log("AUTH_SUCCESS")
                item.class = 'btn-danger'
                item.status_text = 'Disconnect'

                
                item.socket.on(events.updateLatLng, function (d) {
                    console.log(events.updateLatLng, ":", item.driverJSON.phone, item.driverJSON.full_name);
                    console.log(events.updateLatLng, ":", d);
                })
                item.socket.on(events.tripNotification, function (d) {
                    console.log(events.tripNotification, ":", item.driverJSON.phone, item.driverJSON.full_name);
                    console.log(events.tripNotification, ":", d);
                    if (d.status == "call") {
                        item.received_call = true;
                        item.call = d.data;
                        var ack = d.data;
                        ack.pass_id = item.call.passenger_id;
                        item.timer = timer;
                        ack.delay = item.timer;
                        ack._id = item.driverJSON._id;
                        ack.token_id = item.driverJSON.token_id;
                        item.socket.emit(events.Acknowledgement, ack);
                        startTimer(item);
                    }
                })
                item.socket.on(events.CALL_DRIVER, function (d) {
                    console.log(events.CALL_DRIVER, ":", item.driverJSON.phone, item.driverJSON.full_name);
                    console.log(events.CALL_DRIVER, ":", d);
                    item.received_call_multi = true;
                    console.log(item.received_call_multi)
                    item.timer = timer;
                    item.call = d.data;
                    var ack = {};
                    ack._id = item.driverJSON._id;
                    ack.token_id = item.driverJSON.token_id;
                    ack.lat = item.driverJSON.current_lat;
                    ack.lng = item.driverJSON.current_lng;
                    ack.trip_type = 'batch';
                    ack.batch_id = d.data.batch_id;

                 //   item.socket.emit(events.CALL_DRIVER_ACKNOWLEDGE, ack);
                    startTimer(item);
                });
                item.socket.on(events.Acknowledgement, function (d) {
                    console.log(events.Acknowledgement, " :", item.driverJSON.phone, item.driverJSON.full_name);
                    console.log(events.Acknowledgement, ":", d);
                });
                item.socket.on(events.acceptCall, function (d) {
                    console.log(events.acceptCall, " :", item.driverJSON.phone, item.driverJSON.full_name);
                    console.log(events.acceptCall, ":", d);
                });
                item.socket.on('event', function (data) {
                });
                item.socket.on('disconnect', function () {

                    item.class = 'btn-default'
                    item.status_text = 'Connect'

                });
            });
        }
    }
    function acceptCall(item){
        var data = {"pid": item.call.passenger_id, "tid": item.call.trip_id, "accept_seconds": item.timer,_id:item.driverJSON._id,token_id:item.driverJSON.token_id};

        item.socket.emit(events.acceptCall,data);
    }
    function acceptCallMulti(item){

        item.socket.emit(events.DRIVER_ACCEPTED,data);
    }
    function startTimer(item) {
        console.log(item.timer)
        if(item.timer!=0) {
            --item.timer;
            $timeout(function(){ startTimer(item)},1000);
        } else {
            item.received_call = false;
            item.received_call_multi = false;
        }
    }
    function rec(){
        console.log("START")
        $timeout(check,20000);
    }
    function check(){
        console.log(new Date())
        for (item of $scope.socketUser) {
            if (item.socket && item.socket.connected) {
                item.class = 'btn-danger'
                item.status_text = 'Disconnect'
                if (item.driver != '') {
                        item.driver = item.driver.replace(/ObjectId/g, '')
                        item.driver = item.driver.replace(/ISODate/g, '')
                        item.driver = item.driver.replace(/"\)/g, '"')
                        item.driver = item.driver.replace(/\("/g, '"')
                        item.driverJSON = JSON.parse(item.driver)
                    var update = {
                        _id: item.driverJSON._id,
                        token_id: item.driverJSON.token_id,
                        lat: item.driverJSON.current_lat, // latitude
                        lng: item.driverJSON.current_lng, // longitude
                        status: 'free', // longitude
                    }

                    console.log(update)
              //      item.socket.emit(events.updateLatLng,update);
                    updateLocation(update)
                }
            }
        }
        rec();
    }
    rec();
    function updateLocation(data) {
        $http({
            method: 'put',
            url: $scope.url+"/api/v1/driver/update/location",
            data:data
        }).then(function successCallback(response) {
            console.log(response)
            // this callback will be called asynchronously
            // when the response is available
        }, function errorCallback(response) {
            // called asynchronously if an error occurs
            // or server returns response with an error status.
        });
    }
    function disconnect (item){
        item.socket.close()
    }
    var ObjectId = function(str){
        return str;
    }
    var ISODate = function(str) {
        return this.str;
    }

});